import React, {useContext} from "react"
import './Plants.css'
import AppContext from "../Context";

function Plants(){
    let {paramPosts} = useContext(AppContext)
    return(
        <>
        <div className="plants-main">
            <button onClick={() => {paramPosts("plants", "annuals:", "314")}} className="plants-inner annuals">Annuals</button>
            <a href="/plants/perennials" className="plants-inner perennials">Perennials</a>
            <a href="/plants/fruits" className="plants-inner fruits">Fruits</a>
            <a href="/plants/veggies" className="plants-inner veggies">Veggies</a>
        </div>
        </>
    );
}

export default Plants;
